import React, { Component } from 'react';
import Axios from 'axios';

const Login = () => {
    return ( 
        <div>
                Login into your account:

            <form>
            <label>
              Email:
              <input type="text" name="email" />
            </label>
            <label>
              Password:
              <input type="text" name="password" />
            </label>
            <input type="submit" value="Submit" />
          </form>
          </div>
     );
}

export default Login;
